    return (
        <Fragment>
            <div className="landing-page">
                <nav className="navbar mobile-hide">
                    <a href="#categories" className="active">RECIPES</a>
                    <a href="#">BEERS</a>
                    <a href="auth/login.html">LOGIN</a>
                </nav>

                <div className="logo">
                    <h1>Hill <br /> Brewing <br /> Co</h1>
                    <hr className="logo-line" />
                    <p className="est">Est 2018</p>
                </div>
            </div>
        </Fragment>
    )
}

export default Landing;
